import { Container,Col,Row } from "reactstrap";
import Header from "./components/Header";
function App() {
  return (
    <>
      <Container>
        <Row>
          <Header></Header>
        </Row>
        <Row>
          <Col xs="12" sm="6">

          </Col>
        </Row>
      </Container>
    </>
  );
}

export default App;
